DROP TABLE IF EXISTS `vw_perkiraan`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vw_perkiraan` AS select `tb_perkiraan`.`id_perkiraan` AS `id_perkiraan`,`tb_perkiraan`.`no_perkiraan` AS `no_perkiraan`,`tb_perkiraan`.`nama_perkiraan` AS `nama_perkiraan`,`tb_perkiraan`.`kelompok_perkiraan` AS `kelompok_perkiraan`,`tb_perkiraan`.`status_header` AS `status_header`,`tb_perkiraan`.`link` AS `link`,`tb_saldoblnlalu`.`id_saldoblnlalu` AS `id_saldoblnlalu`,`tb_saldoblnlalu`.`id_periode` AS `id_periode`,`tb_saldoblnlalu`.`tgl_transaksi` AS `tgl_transaksi`,`tb_saldoblnlalu`.`debet` AS `debet`,`tb_saldoblnlalu`.`kredit` AS `kredit`,`tb_saldoblnlalu`.`status` AS `status` from (`tb_saldoblnlalu` join `tb_perkiraan` on((`tb_saldoblnlalu`.`no_perkiraan` = `tb_perkiraan`.`no_perkiraan`)));

