CREATE TABLE `tb_user` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `nama_user` varchar(255) NOT NULL,
  `username` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `level` varchar(25) NOT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `inv`;
CREATE TABLE `inv` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `invoice` varchar(255) NOT NULL,
  `bukti` varchar(255) NOT NULL,
  `tanggal_upload` varchar(255) NOT NULL,
  `Keterangan` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `peserta`;
CREATE TABLE `peserta` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nama` varchar(255) NOT NULL,
  `hp` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `institusi` varchar(255) NOT NULL,
  `jenis_peserta` varchar(255) NOT NULL,
  `status_peserta` varchar(255) NOT NULL,
  `keterangan_peserta` varchar(255) NOT NULL,
  `mata_uang` varchar(5) NOT NULL,
  `conference` varchar(255) NOT NULL,
  `gemstone` varchar(255) NOT NULL,
  `git` varchar(255) NOT NULL,
  `so` varchar(255) NOT NULL,
  `fieldtrip` varchar(255) NOT NULL,
  `invoice` varchar(255) NOT NULL,
  `status` varchar(255) NOT NULL,
  `tanggal` varchar(255) NOT NULL,
