DROP TABLE IF EXISTS `astm d6224 versiion (by unit no)`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `astm d6224 versiion (by unit no)` AS select `tbl_konversi`.`UNIT_NO` AS `UNIT_NO`,`tbl_konversi`.`COMPONENT` AS `COMPONENT`,`tbl_konversi`.`EVAL_CODE` AS `EVAL_CODE`,count(`tbl_konversi`.`Lab_No`) AS `Count`,(avg(`tbl_konversi`.`FE_KONV`) + std(`tbl_konversi`.`FE_KONV`)) AS `Fe_B`,(avg(`tbl_konversi`.`FE_KONV`) + (2 * std(`tbl_konversi`.`FE_KONV`))) AS `Fe_C`,(avg(`tbl_konversi`.`AL_KONV`) + std(`tbl_konversi`.`AL_KONV`)) AS `Al_B`,(avg(`tbl_konversi`.`AL_KONV`) + (2 * std(`tbl_konversi`.`AL_KONV`))) AS `Al_C`,(avg(`tbl_konversi`.`CU_KONV`) + std(`tbl_konversi`.`CU_KONV`)) AS `Cu_B`,(avg(`tbl_konversi`.`CU_KONV`) + (2 * std(`tbl_konversi`.`CU_KONV`))) AS `Cu_C`,(avg(`tbl_konversi`.`CR_KONV`) + std(`tbl_konversi`.`CR_KONV`)) AS `Cr_B`,(avg(`tbl_konversi`.`CR_KONV`) + (2 * std(`tbl_konversi`.`CR_KONV`))) AS `Cr_C`,(avg(`tbl_konversi`.`SI_KONV`) + std(`tbl_konversi`.`SI_KONV`)) AS `Si_B`,(avg(`tbl_konversi`.`SI_KONV`) + (2 * std(`tbl_konversi`.`SI_KONV`))) AS `Si_C`,(avg(`tbl_konversi`.`PB_KONV`) + std(`tbl_konversi`.`PB_KONV`)) AS `Pb_B`,(avg(`tbl_konversi`.`PB_KONV`) + (2 * std(`tbl_konversi`.`PB_KONV`))) AS `Pb_C`,(avg(`tbl_konversi`.`NA_KONV`) + std(`tbl_konversi`.`NA_KONV`)) AS `Na_B`,(avg(`tbl_konversi`.`NA_KONV`) + (2 * std(`tbl_konversi`.`NA_KONV`))) AS `Na_C`,(avg(`tbl_konversi`.`PQIndex_KONV`) + std(`tbl_konversi`.`PQIndex_KONV`)) AS `PQIndex_B`,(avg(`tbl_konversi`.`PQIndex_KONV`) + (2 * std(`tbl_konversi`.`PQIndex_KONV`))) AS `PQIndex_C` from `tbl_konversi` where (`tbl_konversi`.`calculate` = 0) group by `tbl_konversi`.`UNIT_NO`,`tbl_konversi`.`COMPONENT`,`tbl_konversi`.`EVAL_CODE` having (`Count` > 5);

