DROP TABLE IF EXISTS `mean_std`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `mean_std` AS select `tbl_konversi`.`Matrix` AS `MATRIX`,`tbl_konversi`.`MODEL` AS `MODEL`,`tbl_konversi`.`COMPONENT` AS `COMPONENT`,count(`tbl_konversi`.`Lab_No`) AS `Count`,avg(`tbl_konversi`.`FE_KONV`) AS `FE_AVG`,std(`tbl_konversi`.`FE_KONV`) AS `FE_S.DEV`,avg(`tbl_konversi`.`AL_KONV`) AS `AL_AVG`,std(`tbl_konversi`.`AL_KONV`) AS `AL_S.DEV`,avg(`tbl_konversi`.`CU_KONV`) AS `CU_AVG`,std(`tbl_konversi`.`CU_KONV`) AS `CU_S.DEV`,avg(`tbl_konversi`.`CR_KONV`) AS `CR_AVG`,std(`tbl_konversi`.`CR_KONV`) AS `CR_S.DEV`,avg(`tbl_konversi`.`SI_KONV`) AS `SI_AVG`,std(`tbl_konversi`.`SI_KONV`) AS `SI_S.DEV`,avg(`tbl_konversi`.`PB_KONV`) AS `PB_AVG`,std(`tbl_konversi`.`PB_KONV`) AS `PB_S.DEV`,avg(`tbl_konversi`.`NA_KONV`) AS `NA_AVG`,std(`tbl_konversi`.`NA_KONV`) AS `NA_S.DEV` from `tbl_konversi` where (`tbl_konversi`.`calculate` = 0) group by `tbl_konversi`.`Matrix`,`tbl_konversi`.`MODEL`,`tbl_konversi`.`COMPONENT`;

DROP TABLE IF EXISTS `pr_report`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `pr_report` AS select `tbl_transaction`.`RECV_DT1` AS `RECV_DT1`,`tbl_transaction`.`Lab_No` AS `Lab_No`,`tbl_transaction`.`branch` AS `branch`,`tbl_transaction`.`customer_id` AS `customer_id`,`tbl_transaction`.`ADD_CODE` AS `ADD_CODE`,`tbl_transaction`.`UNIT_NO` AS `UNIT_NO`,`tbl_transaction`.`COMPONENT` AS `COMPONENT` from `tbl_transaction` where (`tbl_transaction`.`ADD_CODE` is not null);

DROP TABLE IF EXISTS `spb_number`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `spb_number` AS select `tbl_transaction`.`RECV_DT1` AS `RECV_DT1`,`tbl_transaction`.`Lab_No` AS `Lab_No`,`tbl_transaction`.`branch` AS `branch`,`tbl_transaction`.`customer_id` AS `customer_id`,`tbl_transaction`.`ADD_VALUE` AS `ADD_VALUE`,`tbl_transaction`.`UNIT_NO` AS `UNIT_NO`,`tbl_transaction`.`COMPONENT` AS `COMPONENT` from `tbl_transaction` where ((`tbl_transaction`.`ADD_VALUE` is not null) and (`tbl_transaction`.`ADD_VALUE` <> 0) and ((isnull(`tbl_transaction`.`ADD_CODE`) = 1) or (`tbl_transaction`.`ADD_CODE` = 0)));

DROP TABLE IF EXISTS `trend_problem`;
